import React from "react";
import Item from "./Item";

const PocketItemContainer = (historys) => {
  return (
    <>
      {historys.map((item) => (
        <div>
          <Item item={item} />
        </div>
      ))}
    </>
  );
};

export default PocketItemContainer;
